/* COLOR THEME *
* com-purple : #31245a
* com-pink : #ac6dbf
* com-dark-blue : #064680
* com-light-blue : #2a7ca3
* com-light-green : #58bbc2
**/
import logo from './logo.svg';
import './App.css';
import Nav from './components';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './ViewContacts'; // ViewContacts component for the "/view" route
import AboutProject from './AboutProject'; // AboutProject component for the "/about" route
import EditContact from './EditContact'; // EditContact component for the "/edit" route



function App() {
  return (
    <div className="App">
      <Nav/>
      <Routes>
        <Route path="/" element={<HomePage/>} />
        <Route path="/login" element={<AboutProject/>} />
        <Route path="/login/:id" element={<EditContact/>} />
      </Routes>

    </div>
  );
  }

export default App;
